import { BrowserRouter, Route, Router } from "react-router-dom";
import Orders from "./Orders";
import Home from "./Home";

function Routes() {
    return (
        <Router >
            <Route path="/orders">
                <Orders/>
            </Route>
            <Route path="/">
                <Home/>
            </Route>
        </Router>
    )
}

export default Routes;
